INSERT INTO `tbl_item` VALUES ('402880e55c590053015c59291f6a0000','2017-05-30 19:41:26',0,'2017-05-30 19:47:54',4,'public class Solution006 {\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\n    \n         int len_1=nums1.length;\n        int len_2=nums2.length;\n        int middle=0;\n        boolean isOdd=false;\n        if((len_1+len_2)%2==0){\n            middle=(len_1+len_2)/2-1;\n            isOdd=false;\n        }else{\n            middle=(len_1+len_2)/2;\n            isOdd=true;\n        }\n        //åˆå¹¶æ’åº\n        int[] num=new int[len_1+len_2];\n        int i=0,l=0,r=0;\n        while(l<len_1&&r<len_2){\n            if(nums1[l]<nums2[r]){\n                num[i]=nums1[l];\n                i++;\n                l++;\n            }else{\n                num[i]=nums2[r];\n                i++;\n                r++;\n            }\n        }\n        while(l<len_1){\n            num[i++]=nums1[l++];\n        }\n        while(r<len_2){\n            num[i++]=nums2[r++];\n        }\n\n        if(!isOdd){\n            return (double)(num[middle]+num[middle+1])/2;\n        }else{\n            return (double)num[middle];\n        }\n    }\n}','','Solution006','**é—®é¢˜æè¿°**\n\nThere are two sorted arrays nums1 and nums2 of size m and n respectively.\n\nFind the median of the two sorted arrays. The overall run time complexity should be O(log (m+n)).\n\n**Example 1:**\n```\nnums1 = [1, 3]\nnums2 = [2]\n\nThe median is 2.0\n```\n\n**Example 2:**\n```\nnums1 = [1, 2]\nnums2 = [3, 4]\n\nThe median is (2 + 3)/2 = 2.5\n```','æœ‰ä¸¤ä¸ªæœ‰åºæ•°ç»„ï¼ŒæŸ¥æ‰¾åˆ°è¿ä¸ªæ•°ç»„ä¸­çš„ä¸­é—´å€¼',NULL,'006',1,'findMedianSortedArrays',1,'æµ‹è¯•',0,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      //do something;\r\n    }\r\n}','ä¸¤ä¸ªæœ‰åºæ•°ç»„ä¸­é—´å€¼',2,'402880e55c590053015c592ee07d0006','leetcode',NULL,NULL),('402880e55c590053015c59732071000c','2017-05-30 21:02:16',0,'2017-05-30 21:02:16',1,'public class Solution007 {\n    public String longestPalindrome(String s) {\n        int max=0;\n        int j=0;\n        //å¥‡å¯¹ç§°æƒ…å†µ\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            boolean flag=true;\n            int index=0;\n            while(flag){\n                if(i-index<0||i+index>=s.length()){\n                    flag=false;\n                    continue;\n                }\n                if(s.charAt(i-index)==s.charAt(i+index)){\n                    index++;\n                }else{\n                    flag=false;\n                }\n            }\n            if(index>max){\n                max=index;\n                j=i-index+1;\n            }\n        }\n\n        int odd=2*(max-1)+1;\n        //å¶å¯¹ç§°\n        max=0;\n        int k=0;\n        for(int i=0;i<s.length();i++){\n            char cur=s.charAt(i);\n            if(i>0){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index-1<0||i+index>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index-1)==s.charAt(i+index)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index;\n                }\n            }\n            if(i+1<s.length()){\n                boolean flag=true;\n                int index=0;\n                while(flag){\n                    if(i-index<0||i+index+1>=s.length()){\n                        flag=false;\n                        continue;\n                    }\n                    if(s.charAt(i-index)==s.charAt(i+index+1)){\n                        index++;\n                    }else{\n                        flag=false;\n                    }\n                }\n                if(index>max){\n                    max=index;\n                    k=i-index+1;\n                }\n            }\n        }\n        int even=2*max;\n        if(odd>even){\n            return s.substring(j,odd+j);\n        }else{\n            return s.substring(k,even+k);\n        }\n        \n    }\n}','','Solution007','**é—®é¢˜æè¿°**\n\nGiven a string s, find the longest palindromic substring in s. You may assume that the maximum length of s is 1000.\n\n**Example 1ï¼š**\n```\nInput: \"babad\"\n\nOutput: \"bab\"\n\nNote: \"aba\" is also a valid answer.\n```\n\n**Example 2ï¼š**\n```\nInput: \"cbbd\"\n\nOutput: \"bb\"\n```','ç»™å®šä¸€ä¸ªå­—ç¬¦ä¸²ï¼ŒæŸ¥æ‰¾æœ€é•¿çš„å›æ–‡å­ä¸²',NULL,'007',1,'longestPalindrome',0,'æµ‹è¯•',0,'public class Solution007 {\r\n   public String longestPalindrome(String s) \r\n      //write your code;\r\n    }\r\n}','æœ€å¤§å›æ–‡ä¸²',1,'402880e55c590053015c597305c2000b','leetcode',NULL,NULL),('402880e55c597d0c015c59a856730000','2017-05-30 22:00:23',0,'2017-05-31 08:50:09',9,'/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}','public class ListNode {\n     int val;\n     ListNode next;\n     ListNode(int x) { val = x; }\n}','Solution008','**é—®é¢˜æè¿°**\n\nYou are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.\n\nYou may assume the two numbers do not contain any leading zero, except the number 0 itself.\n\n**Inputï¼š**\n```\n(2 -> 4 -> 3) + (5 -> 6 -> 4)\n```\n\n**Outputï¼š**\n```\n7 -> 0 -> 8\n```','ç»™å®šä¸¤ä¸ªéç©ºçš„æ•´æ•°é“¾è¡¨ï¼Œæ¯ä¸ªèŠ‚ç‚¹å­˜å‚¨ä¸€ä¸ªæ•´æ•°ï¼Œä¸¤ä¸ªé“¾è¡¨ç›¸åŠ åï¼Œè¿”å›ä¸€ä¸ªæ–°çš„é“¾è¡¨',NULL,'008',3,'addTwoNumbers',1,'',1,'/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        \n    }\n}','ä¸¤é“¾è¡¨ç›¸åŠ ',5,'8a8a82695c5bf692015c5bfb26fd0003','leetcode',NULL,NULL),('402880ed5c30127b015c3055ae2f0001','2017-05-22 21:25:40',0,'2017-05-24 16:41:10',32,'public class Solution1 {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','','Solution1','\n####é—®é¢˜æè¿°\n\nä¸€ç§åŒæ ¸CPUçš„ä¸¤ä¸ªæ ¸èƒ½å¤ŸåŒæ—¶çš„å¤„ç†ä»»åŠ¡ï¼Œç°åœ¨æœ‰nä¸ªå·²çŸ¥æ•°æ®é‡çš„ä»»åŠ¡éœ€è¦äº¤ç»™CPUå¤„ç†ï¼Œå‡è®¾å·²çŸ¥CPUçš„æ¯ä¸ªæ ¸1ç§’å¯ä»¥å¤„ç†1kbï¼Œæ¯ä¸ªæ ¸åŒæ—¶åªèƒ½å¤„ç†ä¸€é¡¹ä»»åŠ¡ã€‚nä¸ªä»»åŠ¡å¯ä»¥æŒ‰ç…§ä»»æ„é¡ºåºæ”¾å…¥CPUè¿›è¡Œå¤„ç†ï¼Œç°åœ¨éœ€è¦è®¾è®¡ä¸€ä¸ªæ–¹æ¡ˆè®©CPUå¤„ç†å®Œè¿™æ‰¹ä»»åŠ¡æ‰€éœ€çš„æ—¶é—´æœ€å°‘ï¼Œæ±‚è¿™ä¸ªæœ€å°çš„æ—¶é—´ã€‚\n\n####è¾“å…¥æè¿°\n```\nè¾“å…¥åŒ…æ‹¬ä¸¤è¡Œï¼š\nç¬¬ä¸€è¡Œä¸ºæ•´æ•°n(1 â‰¤ n â‰¤ 50)\nç¬¬äºŒè¡Œä¸ºnä¸ªæ•´æ•°length[i](1024 â‰¤ length[i] â‰¤ 4194304)ï¼Œè¡¨ç¤ºæ¯ä¸ªä»»åŠ¡çš„é•¿åº¦ä¸ºlength[i]kbï¼Œæ¯ä¸ªæ•°å‡ä¸º1024çš„å€æ•°\n```\n\n####è¾“å‡ºæè¿°\n```\nè¾“å‡ºä¸€ä¸ªæ•´æ•°ï¼Œè¡¨ç¤ºæœ€å°‘éœ€è¦å¤„ç†çš„æ—¶é—´\n```\n\n####è¾“å…¥ç¤ºä¾‹\n\n```\n5\n3072 3072 7168 3072 1024\n```\n\n####è¾“å‡ºç¤ºä¾‹\n```\n9216\n```','ç°åœ¨æœ‰nä¸ªå·²çŸ¥æ•°æ®é‡çš„ä»»åŠ¡éœ€è¦äº¤ç»™CPUå¤„ç†ï¼Œå‡è®¾å·²çŸ¥CPUçš„æ¯ä¸ªæ ¸1ç§’å¯ä»¥å¤„ç†1kbï¼Œæ¯ä¸ªæ ¸åŒæ—¶',NULL,'002',4,'method',100,'æµ‹è¯•',110,'public class Solution1 {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','å¤§æ•°ç›¸ä¹˜',135,'402880ed5c30127b015c305564a30000','',NULL,NULL),('402881925c3fa5c4015c3ff0bd470001','2017-05-25 22:09:20',0,'2017-05-27 17:38:29',32,'public class TwoSum {\n      public int[] main(int[] nums, int target) {\n        int[] ret=new int[2];\n        boolean flag=false;\n        for(int i=0;i<nums.length;i++){\n             int a=nums[i];\n            for(int j=i+1;j<nums.length;j++){\n               if(target-a==nums[j]){\n                   ret[0]=i;\n                   ret[1]=j;\n                   flag=true;\n                   break;\n               }\n            }\n            if(flag)\n               break;\n        }\n        return ret;\n    }\n}','','TwoSum','Given an array of integers, return indices of the two numbers such that they add up to a specific target.\n\nYou may assume that each input would have exactly one solution, and you may not use the same element twice.\n\n**Example**\n```\nGiven nums = [2, 7, 11, 15], target = 9,\n\nBecause nums[0] + nums[1] = 2 + 7 = 9,\nreturn [0, 1].\n```','ç»™å®šä¸€ä¸ªæ•°ç»„å’Œä¸€ä¸ªå€¼ï¼Œæ±‚æ•°ç»„ä¸­ä¸¤ä¸ªå€¼ï¼Œä½¿å¾—ä¹‹å’Œä¸ºç»™å®šå€¼',NULL,'004',1,'main',1,'æµ‹è¯•',25,'public class TwoSum {\r\n    public int[] main(int[] nums,int target) {\r\n      //do something;\r\n    }\r\n}','leetcode-ä¸¤æ•°ä¹‹å’Œ',26,'402881925c3fa5c4015c3fef43da0000','leetcode',NULL,NULL),('402881925c4986bd015c499d23ad0007','2017-05-27 19:14:14',0,'2017-05-28 09:08:02',18,'import java.util.HashMap;\nimport java.util.Map;\n\n/**\n * Created by billJiang on 2017/5/27.\n * e-mail:475572229@qq.com  qq:475572229\n */\npublic class Solution005 {\n    public int lengthOfLongestSubstring(String s) {\n        Map<Character, Integer> map = new HashMap<>();\n        int max = 0;\n        int start = 0;\n        for (int i = 0; i < s.length(); i++) {\n            if (map.containsKey(s.charAt(i))) {\n                start=Math.max(map.get(s.charAt(i))+1,start);\n                if (i - start+1 > max) {\n                    max = i - start+1;\n                }\n\n            }else{\n                if(i-start+1>max)\n                    max=i-start+1;\n            }\n\n            map.put(s.charAt(i), i);\n        }\n        return max;\n    }\n}','','Solution005','Given a string, find the length of the longest substring without repeating characters.\n\n**Examples:**\n\nGiven `\"abcabcbb\"`, the answer is `\"abc\"`, which the length is 3.\n\nGiven `\"bbbbb\"`, the answer is `\"b\"`, with the length of 1.\n\nGiven `\"pwwkew\"`, the answer is `\"wke\"`, with the length of 3.\nNote that the answer must be a substring,` \"pwke\"` is a subsequence and not a substring.\n\n','ç»™å®šä¸€ä¸²å­—ç¬¦ä¸²ï¼Œæ±‚æœ€å¤§é•¿åº¦çš„ä¸é‡å¤çš„å­å­—ç¬¦ä¸²é•¿åº¦',NULL,'005',3,'lengthOfLongestSubstring',1,'æµ‹è¯•',1,'public class Solution005 {\r\n        public int lengthOfLongestSubstring(String s){\r\n      //do something;\r\n    }\r\n}','æœ€å¤§ä¸é‡å¤å­ä¸²',6,'','leetCode',NULL,NULL),('8a8a82575c32a64a015c32cd899d0000','2017-05-23 08:55:49',0,'2017-05-23 08:55:49',6,'public class Solution {\r\n    public int method(int[] nums) {\r\n      //do something;\r\n    }\r\n}','','Solution','\n####é—®é¢˜æè¿°\n\nä¸€ç§åŒæ ¸CPUçš„ä¸¤ä¸ªæ ¸èƒ½å¤ŸåŒæ—¶çš„å¤„ç†ä»»åŠ¡ï¼Œç°åœ¨æœ‰nä¸ªå·²çŸ¥æ•°æ®é‡çš„ä»»åŠ¡éœ€è¦äº¤ç»™CPUå¤„ç†ï¼Œå‡è®¾å·²çŸ¥CPUçš„æ¯ä¸ªæ ¸1ç§’å¯ä»¥