INSERT INTO `tbl_user_item` VALUES ('402880e55c590053015c593373340007','2017-05-30 19:52:43',0,'2017-05-30 19:52:43',0,NULL,'0','402880e55c590053015c59291f6a0000',20,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      //do something;\r\n      return 2.0;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880e55c590053015c5934d6410008','2017-05-30 19:54:13',0,'2017-05-30 19:54:13',0,NULL,'1','402880e55c590053015c59291f6a0000',100,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      int len_1=nums1.length;\r\n        int len_2=nums2.length;\r\n        int middle=0;\r\n        boolean isOdd=false;\r\n        if((len_1+len_2)%2==0){\r\n            middle=(len_1+len_2)/2-1;\r\n            isOdd=false;\r\n        }else{\r\n            middle=(len_1+len_2)/2;\r\n            isOdd=true;\r\n        }\r\n        //åˆå¹¶æ’åº\r\n        int[] num=new int[len_1+len_2];\r\n        int i=0,l=0,r=0;\r\n        while(l<len_1&&r<len_2){\r\n            if(nums1[l]<nums2[r]){\r\n                num[i]=nums1[l];\r\n                i++;\r\n                l++;\r\n            }else{\r\n                num[i]=nums2[r];\r\n                i++;\r\n                r++;\r\n            }\r\n        }\r\n        while(l<len_1){\r\n            num[i++]=nums1[l++];\r\n        }\r\n        while(r<len_2){\r\n            num[i++]=nums2[r++];\r\n        }\r\n\r\n        if(!isOdd){\r\n            return (double)(num[middle]+num[middle+1])/2;\r\n        }else{\r\n            return (double)num[middle];\r\n        }\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880e55c590053015c593769440009','2017-05-30 19:57:02',0,'2017-05-30 19:57:02',0,NULL,'1','402880e55c590053015c59291f6a0000',100,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      int len_1=nums1.length;\r\n        int len_2=nums2.length;\r\n        int middle=0;\r\n        boolean isOdd=false;\r\n        if((len_1+len_2)%2==0){\r\n            middle=(len_1+len_2)/2-1;\r\n            isOdd=false;\r\n        }else{\r\n            middle=(len_1+len_2)/2;\r\n            isOdd=true;\r\n        }\r\n        //åˆå¹¶æ’åº\r\n        int[] num=new int[len_1+len_2];\r\n        int i=0,l=0,r=0;\r\n        while(l<len_1&&r<len_2){\r\n            if(nums1[l]<nums2[r]){\r\n                num[i]=nums1[l];\r\n                i++;\r\n                l++;\r\n            }else{\r\n                num[i]=nums2[r];\r\n                i++;\r\n                r++;\r\n            }\r\n        }\r\n        while(l<len_1){\r\n            num[i++]=nums1[l++];\r\n        }\r\n        while(r<len_2){\r\n            num[i++]=nums2[r++];\r\n        }\r\n\r\n        if(!isOdd){\r\n            return (double)(num[middle]+num[middle+1])/2;\r\n        }else{\r\n            return (double)num[middle];\r\n        }\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880e55c590053015c593b8813000a','2017-05-30 20:01:32',0,'2017-05-30 20:01:32',0,NULL,'1','402880e55c590053015c59291f6a0000',100,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      int len_1=nums1.length;\r\n        int len_2=nums2.length;\r\n        int middle=0;\r\n        boolean isOdd=false;\r\n        if((len_1+len_2)%2==0){\r\n            middle=(len_1+len_2)/2-1;\r\n            isOdd=false;\r\n        }else{\r\n            middle=(len_1+len_2)/2;\r\n            isOdd=true;\r\n        }\r\n        //åˆå¹¶æ’åº\r\n        int[] num=new int[len_1+len_2];\r\n        int i=0,l=0,r=0;\r\n        while(l<len_1&&r<len_2){\r\n            if(nums1[l]<nums2[r]){\r\n                num[i]=nums1[l];\r\n                i++;\r\n                l++;\r\n            }else{\r\n                num[i]=nums2[r];\r\n                i++;\r\n                r++;\r\n            }\r\n        }\r\n        while(l<len_1){\r\n            num[i++]=nums1[l++];\r\n        }\r\n        while(r<len_2){\r\n            num[i++]=nums2[r++];\r\n        }\r\n\r\n        if(!isOdd){\r\n            return (double)(num[middle]+num[middle+1])/2;\r\n        }else{\r\n            return (double)num[middle];\r\n        }\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880eb5c4c8e52015c4c9eb6a20004','2017-05-28 09:14:48',0,'2017-05-28 09:14:48',0,NULL,'0','402881925c4986bd015c499d23ad0007',37,'public class Solution005 {\r\n    public int lengthOfLongestSubstring(String s){\r\n      //do something;\r\n       return 3;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880eb5c4c8e52015c4ca01f750005','2017-05-28 09:16:21',0,'2017-05-28 09:16:21',0,NULL,'1','402881925c4986bd015c499d23ad0007',100,'import java.util.HashMap;\r\nimport java.util.Map;\r\n\r\n/**\r\n * Created by billJiang on 2017/5/27.\r\n * e-mail:475572229@qq.com  qq:475572229\r\n */\r\npublic class Solution005 {\r\n    public int lengthOfLongestSubstring(String s) {\r\n        Map<Character, Integer> map = new HashMap<>();\r\n        int max = 0;\r\n        int start = 0;\r\n        for (int i = 0; i < s.length(); i++) {\r\n            if (map.containsKey(s.charAt(i))) {\r\n                start=Math.max(map.get(s.charAt(i))+1,start);\r\n                if (i - start+1 > max) {\r\n                    max = i - start+1;\r\n                }\r\n\r\n            }else{\r\n                if(i-start+1>max)\r\n                    max=i-start+1;\r\n            }\r\n\r\n            map.put(s.charAt(i), i);\r\n        }\r\n        return max;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880eb5c4d796c015c4d80aecf0000','2017-05-28 13:21:38',0,'2017-05-28 13:21:38',0,NULL,'1','402881925c4986bd015c499d23ad0007',100,'import java.util.HashMap;\r\nimport java.util.Map;\r\n\r\n/**\r\n * Created by billJiang on 2017/5/27.\r\n * e-mail:475572229@qq.com  qq:475572229\r\n */\r\npublic class Solution005 {\r\n    public int lengthOfLongestSubstring(String s) {\r\n        Map<Character, Integer> map = new HashMap<>();\r\n        int max = 0;\r\n        int start = 0;\r\n        for (int i = 0; i < s.length(); i++) {\r\n            if (map.containsKey(s.charAt(i))) {\r\n                start=Math.max(map.get(s.charAt(i))+1,start);\r\n                if (i - start+1 > max) {\r\n                    max = i - start+1;\r\n                }\r\n\r\n            }else{\r\n                if(i-start+1>max)\r\n                    max=i-start+1;\r\n            }\r\n\r\n            map.put(s.charAt(i), i);\r\n        }\r\n        return max;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880eb5c5f10af015c5f1291290000','2017-05-31 23:14:31',0,'2017-05-31 23:14:31',0,NULL,'1','402880e55c597d0c015c59a856730000',100,'\n/**\n * Definition for singly-linked list.\n * public class ListNode {\n *     int val;\n *     ListNode next;\n *     ListNode(int x) { val = x; }\n * }\n */\npublic class Solution008 {\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\n        ListNode head=null;\n        ListNode current=null;\n        \n        ListNode nextNode=l1;\n        int pre=0;\n        while(nextNode!=null){\n            if(head==null){\n               head=new ListNode((l1.val+l2.val)%10+pre);\n               current=head;\n            }\n            else{\n                ListNode node=new ListNode((l1.val+l2.val)%10+pre);\n                current.next=node;\n                current=node;\n            }\n            if(current.val>=10) {\n                pre=current.val/10;\n                current.val=current.val%10;\n            }else {\n                pre = (l1.val + l2.val) / 10;\n            }\n            l1=l1.next;\n            l2=l2.next;\n            if(l1==null&&l2!=null){\n               nextNode=l2;\n               l1=new ListNode(0);\n            }\n            if(l2==null&&l1!=null){\n                nextNode=l1;\n                l2=new ListNode(0);\n            }\n            if(l1==null&&l2==null){\n                nextNode=null;\n            }\n        }\n        if(pre>0){\n            current.next=new ListNode(pre);\n        }\n       return head;\n    }\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880eb5c5f10af015c5f12e1510001','2017-05-31 23:14:51',0,'2017-05-31 23:14:51',0,NULL,'1','8a8a82575c3cfb3d015c3d32c6220003',100,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n      //wirte your code\r\n      int max=numArr[0];\r\n      for(int i=1;i<numArr.length;i++){\r\n          if(max<numArr[i])\r\n            max=numArr[i];\r\n      }\r\n      return max;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402881925c487af4015c493661f30000','2017-05-27 17:21:59',0,'2017-05-27 17:21:59',0,NULL,'1','8a8a82575c3cfb3d015c3d32c6220003',100,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n      //wirte your code\r\n      int max=numArr[0];\r\n      for(int i=1;i<numArr.length;i++){\r\n          if(max<numArr[i])\r\n            max=numArr[i];\r\n      }\r\n      return max;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402881925c487af4015c4936a6880001','2017-05-27 17:22:17',0,'2017-05-27 17:22:17',0,NULL,'0','8a8a82575c3cfb3d015c3d32c6220003',42,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n      //wirte your code\r\n      int max=numArr[0];\r\n      for(int i=1;i<numArr.length;i++){\r\n          if(max<numArr[i])\r\n            max=numArr[i]+1;\r\n      }\r\n      return max;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402881925c487af4015c49370a290002','2017-05-27 17:22:42',0,'2017-05-27 17:22:42',0,NULL,'0','8a8a82575c3cfb3d015c3d32c6220003',42,'public class MaxNumber {\r\n    public int getMax(int[] numArr) {\r\n      //wirte your code\r\n      int max=numArr[0];\r\n      for(int i=1;i<numArr.length;i++){\r\n          if(max<numArr[i])\r\n            max=numArr[i]+1;\r\n      }\r\n      return max;